Teaser:
Executeu els vostres programes C/C++ a ChATGPT mitjançant aquest indicador. Aquest és un missatge molt potent per executar tot tipus de llenguatges de codificació directament al vostre navegador web mitjançant Chatgpt.

 Només cal que introduïu el codi C o C++ que voleu executar a l'indicador i Chat-GPT us donarà la sortida d'aquest programa en resposta.

 Això és útil si no teniu un compilador instal·lat al vostre ordinador i voleu provar algun codi ara podeu fer-ho amb un simple missatge.

 Exemple de codi C++.
 #inclou <Istream>

 int main() {
  std::cout << "Hola xat-gpt3" << std::endl;
  retorn 0;
 }
